post_text:
Thus far, we have attempted to answer questions, by replying to individual parents and community members, regarding the following topics in the thread of the letter posted:

(1) graduation;
(2) other senior activities;
(3) how to access instructional packets with no internet;
(4) how to obtain a paper copy of the instructional packet;
(5) when the instructional packets will be ready;
(6) where the paper copies can be picked up/accessed; and
(7) how long school is out (March 20th at this time)

Please continue to check the school district website as well as this page as we update the information throughout the day and night.

